import React, { Component } from 'react';
import 'antd/dist/antd.css'
import { Input } from 'antd';

class TodoList extends Component {
    constructor(props) {
        super(props);
        this.state = {}
    }
    render() {
        return (
            <div>
                <div>
                    <Input placeholder='please add task' style={{ width: '250px' }}></Input>
                </div>
            </div>
        );
    }
}

export default TodoList;
